import './App.css';
import React, { Component } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';

// function AddUser(){
  const AddUser = () => {
    
  const [userData, setUser] = useState({
    fname:"",
    lname:"",
    email:"",
    phone:"",
    gender:"",
    role:"",
    city:"",
    state:"",
    id_no:"",
  });
 function onTextChanges(e){
   setUser({
     ...userData,
     [e.traget.name]: e.traget.value
      })
     console.log(userData);
 }
 
 async function onFormSubmit(e) {
  e.preventDefault()
  try {
   await axios.post('http://localhost/PHPReact/add_user.php', userData)
   setUser(true);
  } catch (error) {
   console.log("Something is Wrong");
  }
 }
 
  return(
<div className="container">
      <form >
        <div className="left">
          <div className="form-group col-md-6">
            <label>First Name</label>
            <input type="text" name="fname" className="form-control" id="fname" 
            onChange={e => onTextChanges(e)} />
          </div>
          <div className="form-group col-md-6">
            <label>Last Name</label>
            <input type="text" name="lname" className="form-control" id="lname"  
            onChange={e => onTextChanges(e)} />
          </div>
          <div className="form-group col-md-6">
            <label>Email</label>
            <input type="text" name="email" className="form-control" id="email"  
            onChange={e => onTextChanges(e)} />
          </div>

          <div className="form-group col-md-6">
            <label>Phone Number</label>
            <input type="text" name="phone" className="form-control" id="phone"  
            onChange={e => onTextChanges(e)} />
          </div>
          <div className="form-group col-md-6">
            <label>Gender</label>
            <input type="text" name="gender" className="form-control" id="gender"  onChange={e => onTextChanges(e)} />
          </div>
          <div className="form-group col-md-6">
            <label>User Role</label>
            <input type="text" name="role" className="form-control" id="role"  onChange={e => onTextChanges(e)} />
          </div>
        </div>
        <div className="right">
          <div className="form-group col-md-6">
            <label>City</label>
            <input type="text" name="city" className="form-control" id="city"  onChange={e => onTextChanges(e)} />
          </div>
          <div className="form-group col-md-6">
            <label>State</label>
            <input type="text" name="state" className="form-control" id="state"  onChange={e => onTextChanges(e)} />
          </div>
          <div className="form-group col-md-6">
            <label>ID Number</label>
            <input type="text" name="id_no" className="form-control" id=""  onChange={e => onTextChanges(e)} />
          </div>
          <div className="form-group col-md-6">
            <label>Address</label>
            <input type="text" name="address" className="form-control" id="address"  onChange={e => onTextChanges(e)} />
          </div>
        </div>
        <button type="submit" className="btn btn-primary" onClick={e => onFormSubmit(e)} >Sign Up</button>
      </form>
    </div>
);
}

export default AddUser;
